column8:
・超高級刃使用の最上位モデル<br>
・ハイパワー400Wモーター搭載でパワフルな刈込み！<br>
・堅いものをかみ込んでしまった際に、刃先がロックしても<br>&nbsp;&nbsp;バンパークラッチが働いて
モーターへのダメージを軽くします。<br><br>

［電流］<br>
4.2A<br><br>

［消費電力］<br>
400W<br><br>

［ストローク］<br>
1,900min-1<br><br>

［質量］<br>
2.3kg<br><br>










