枝打プロにおすすめ！ハイパワー＆大後傾ハンドルのトップハンドルソー。<br />
フィンガーEZ：指一本でエンジン始動できます。<br />
<br />
■仕様■<br />
<br />
１．エンジン仕様 <br />
　排気量：25.4 cm3<br />
　キャブレター：ダイヤフラム式バタフライバルブ（始動ポンプ付き）<br />
　燃料タンク容量：0.23 L<br />
　イグニションシステム：CDIマグネト<br />
　スパークプラグ：チャンピオン RCJ7Y<br />
<br />
２．タンク容量 <br />
　オイルタンク容量：0.16 L<br />
<br />
３．振動・騒音値　データ <br />
　3軸合成値：4.8 m/s2<br />
<br />
４．バー・チェンブレーキ <br />
　チェンピッチ：1/4"<br />
<br />
５．外形寸法 <br />
　本体乾燥質量：2.8 kg<br />
<br />
６．物流梱包データ<br />
　全長・全幅・全高：26x22x21 cm<br />
<br />
