・3～5坪の芝刈に最適<br>
・立ったままの姿勢で楽に作業<br>
・ポール角度、5段階調節<br>
・刈込高さ、3段階調節<br>
・両刃駆動<br><br>



【刈込幅】<br>
160mm(両刃駆動)<br><br>

【刈込高さ調整】<br>
